package lettersequences;

public class MorganAndAString {
    public static void main(String[] args) {
        String a = "";
        String b = "";
        String exOutput = "";
        String output = morganAndString(a, b);
        System.out.println(output);
        int count = 0;
        for (int i = 0; i < output.length(); i++) {
            if (exOutput.charAt(i) != output.charAt(i)) {
                System.out.printf("%c:%c%d ", output.charAt(i), exOutput.charAt(i), i);
                count++;
            }
        }
        System.out.printf("total: %d", count);
    }

    public static String morganAndString(String a, String b) {
        int ac = 0;
        int bc = 0;
        int sameC = 0;
        boolean greater = true; // true is a and false is b
        int al = a.length();
        int bl = b.length();
        StringBuilder sb = new StringBuilder();

        while (ac < al && bc < bl) {
            char apc = a.charAt(ac);
            char bpc = b.charAt(bc);
            if (apc < bpc) {
                sb.append(apc);
                ac++;
            } else if (bpc < apc) {
                sb.append(bpc);
                bc++;
            } else if (ac + bc < sameC) {
                if (greater) {
                    sb.append(apc);
                    ac++;
                } else {
                    sb.append(bpc);
                    bc++;
                }
            } else {
                int ai = ac + 1;
                int bi = bc + 1;

                while (ai < al && bi < bl) {
                    char aipc = a.charAt(ai);
                    char bipc = b.charAt(bi);
                    if (aipc == bipc) {
                        ai++;
                        bi++;
                    } else if (aipc < bipc) {
                        sameC = ai + bc;
                        greater = true;
                        break;
                    } else {
                        sameC = ai + bc;
                        greater = false;
                        break;
                    }
                }

                if (ai >= al) {
                    sameC = ai + bc;
                    greater = true;
                } else if (bi >= bl) {
                    sameC = bi + ac;
                    greater = false;
                }
            }
        }
        if (ac >= al) {
            sb.append(b.substring(bc, bl));
        } else {
            sb.append(a.substring(ac, al));
        }
        return sb.toString();
    }
}
